import React from "react";
import "./Project.scss";

import Badge from "../Badge/Badge";

export default function Project({ data }) {
  console.log(data);
  return (
    <article className="project">
      <img
        className="project__img"
        alt={"Screenshot of " + data.title}
        src={"http://localhost:1337" + data.image.data.attributes.url}
      />
      <h3 className="project__title">{data.title}</h3>
      <p className="project__description">{data.description}</p>
      <Badge className="project__badge">api</Badge>
    </article>
  );
}
